import { Container ,Paper,Button} from '@material-ui/core';
import { useNavigate } from "react-router-dom"

export const Main = () => {
    const navigate = useNavigate()
    const [clubs, setClubs] = useState({})

    useEffect(()=>{
        fetch("http://localhost:8081/clubs/getAll")
        .then(res=>res.json())
        .then((result)=>{
            console.log(result)
          setClubs(result);
        }
      )
      },[])
    return (
        <div> 

        </div>
    )
}
